package az.ematrix.ticketbot.dto.userDto;import jakarta.validation.constraints.Email;import jakarta.validation.constraints.NotBlank;import jakarta.validation.constraints.NotNull;import lombok.*;@Data@Builder@NoArgsConstructor@AllArgsConstructorpublic class UserDto  {    @NotBlank(message = "User name cannot be blank")    @NotNull(message = "User name cannot be null")    private String userName;    @NotBlank(message = "Email cannot be blank")    @Email(message = "Invalid email format")    private String email;    @NotBlank(message = "Search cannot be blank")    private String search;}